// src/HomePage.js
import { useNavigate } from 'react-router-dom';

export default function HomePage() {
  const navigate = useNavigate();

  return (
    <main className="min-h-screen bg-gray-900 text-white flex flex-col items-center justify-center text-center px-4">
      <img src="/logo.png.jpg" alt="logo" className="h-12 w-12 rounded-xl mb-4" />
      <h1 className="text-4xl font-bold mb-8">Bem-vindo ao Safeswap</h1>

      <div className="flex flex-col md:flex-row gap-6">
        <button
          onClick={() => alert("Funcionalidade de venda ainda será implementada")}
          className="bg-green-600 hover:bg-green-700 text-white px-8 py-4 rounded-lg text-xl"
        >
          Venda
        </button>

        <button
          onClick={() => navigate('/revenda')}
          className="bg-blue-600 hover:bg-blue-700 text-white px-8 py-4 rounded-lg text-xl"
        >
          Revenda
        </button>
      </div>
    </main>
  );
}
